var c = document.getElementById('c')
var v = document.getElementById('v')
var mg = document.querySelector('html')
var install = document.getElementById('mg')
var video = document.getElementById('video')

// video.pause()
var game;
var gameLoaded = false;
var createOnLoaded = false;
var this_, hand_arr = [],
    answer_arr = [],
    num = 0
window.onload = function () {
    c.style.visibility = "hidden";
    var gameConfig = {
        type: Phaser.AUTO,
        parent: 'c',
        width: 512,
        height: 800,
        backgroundColor: 0x000000,
        scene: [playGame]
    };
    game = new Phaser.Game(gameConfig);
}

class playGame extends Phaser.Scene {

    constructor() {
        super("PlayGame");
    }

    preload() {
        if (gameLoaded) {
            return;
        }

        var pic_name = [],
            addFlag = false;

        for (var p1 in assets) {
            if (assets.hasOwnProperty(p1))
                pic_name.push(p1);
        }
        for (var i = 0; i < pic_name.length; i++) {
            this.textures.addBase64(pic_name[i], eval("assets." + pic_name[i]))
        }

        var imageCount = pic_name.length;
        var loadedCount = 0;
        this.textures.on('addtexture', function () {
            loadedCount++;
            if (imageCount == loadedCount) {
                gameLoaded = true;
                if (createOnLoaded) {
                    this.create();
                }
            }
        }, this);
    }

    create() {
        if (!gameLoaded) {
            createOnLoaded = true;
            return;
        }
        this_ = this
        video.play()
        this.bg = this.add.image(256, 400, 'bg1')
        this.hand()
        install.onclick = function (params) {
            landingPage()
        }
      
        this.resize();
        window.addEventListener("resize", this.resize, false);
    }

    update() {
        if (!gameLoaded) {
            createOnLoaded = true;
            return;
        }
        // console.log(video.currentTime.toFixed(1))
        this.showHand()
        if (video.currentTime.toFixed(1) == 3.5 && num == 0) {
            c.style.visibility = "visible";
            video.pause()
            setTimeout(() => {
                this.rabbit()
                setTimeout(() => {
                    this.hand.visible = 1
                }, 400);
            }, 500);
            num = 1
        }
        if (answer_arr[0] == 'it') {
            setTimeout(() => {
                video.play()
                c.style.visibility = 'hidden'
                this.bg.destroy()
                this.bg = this.add.image(256, 400, 'bg2')
            }, 500);
            answer_arr = []
        }

        if (video.currentTime.toFixed(1) == 5.7 && num == 1) {
            c.style.visibility = "visible";
            video.pause()
            setTimeout(() => {
                this.balloon()
            }, 500);
            num = 2
        }

        if (answer_arr[0] == 'oon') {
            setTimeout(() => {
                video.play()
                c.style.visibility = 'hidden'
                this.bg.destroy()
                this.bg = this.add.image(256, 400, 'bg3')

            }, 500);
            answer_arr = []
        }
        if (video.currentTime.toFixed(1) == 9.0 && num == 2) {
            c.style.visibility = "visible";
            video.pause()
            setTimeout(() => {
                this.makeup()
            }, 500);
            num = 3
        }
        if (answer_arr[0] == 'keup') {
            setTimeout(() => {
                video.play()
                c.style.visibility = 'hidden'
            }, 500);
            answer_arr = []
        }
        if (video.currentTime.toFixed(1) == 22.0 && num == 3) {
            video.onclick = function () {
                landingPage()
            }
            num = 4
        }
        if(video.currentTime.toFixed(1) == 23.2){
            video.currentTime = 21.6
            video.play()
        }
    }

    rabbit() {
        var letters = ['r', 'b', 'i', 'a', 'b', 't']
        this.showWords1(letters, {
            name: 'words',
            x: 256,
            y: 580
        }, 'it')
        setTimeout(() => {
            this.hand.visible = 1
            this.box1 = this.add.image(256 - 163, 480, 'box').setDepth(2)
            this.box2 = this.add.image(256 - 98, 480, 'box').setDepth(2)
            this.box3 = this.add.image(256 - 33, 480, 'box').setDepth(2)
            this.box4 = this.add.image(256 + 32, 480, 'box').setDepth(2)
            this.p = this.add.image(256 - 163, 480, 'r1').setDepth(2)
            this.i = this.add.image(256 - 98, 480, 'a1').setDepth(2)
            this.l = this.add.image(256 - 33, 480, 'b1').setDepth(2)
            this.l2 = this.add.image(256 + 32, 480, 'b1').setDepth(2)
        }, 300);
    }
    balloon() {
        var letters = ['a', 'l', 'l', 'o', 'b', 't', 'o', 'n']
        this.showWords2(letters, {
            name: 'words',
            x: 256,
            y: 580
        }, 'oon')
        setTimeout(() => {
            this.box1 = this.add.image(256 - 153, 480, 'box').setDepth(2).setScale(0.8)
            this.box2 = this.add.image(256 - 103, 480, 'box').setDepth(2).setScale(0.8)
            this.box3 = this.add.image(256 - 53, 480, 'box').setDepth(2).setScale(0.8)
            this.box4 = this.add.image(256 + 53, 480, 'box').setDepth(2).setScale(0.8)
            this.p = this.add.image(256 - 153, 480, 'b1').setDepth(2).setScale(0.8)
            this.i = this.add.image(256 - 103, 480, 'a1').setDepth(2).setScale(0.8)
            this.l = this.add.image(256 - 53, 480, 'l1').setDepth(2).setScale(0.8)
            this.l2 = this.add.image(256, 480, 'l1').setDepth(2).setScale(0.8)
        }, 300);
    }
    makeup() {
        // var zzc = this.add.image(0, 0, 'bg3').setOrigin(0, 0).setDepth(5).setInteractive().setAlpha(0.001).once(
        //     'pointerdown',
        //     function (params) {
        //         this.showDownload()

        var letters = ['m', 'k', 'u', 'e', 'p', 'a']
        this.showWords1(letters, {
            name: 'words',
            x: 256,
            y: 580
        }, 'keup')
        setTimeout(() => {
            this.box1 = this.add.image(256 - 163, 480, 'box').setDepth(2)
            this.box2 = this.add.image(256 - 98, 480, 'box').setDepth(2)
            this.box3 = this.add.image(256 - 33, 480, 'box').setDepth(2)
            this.box4 = this.add.image(256 + 32, 480, 'box').setDepth(2)
            this.p = this.add.image(256 - 163, 480, 'm1').setDepth(2)
            this.i = this.add.image(256 - 98, 480, 'a1').setDepth(2)
            this.l = this.add.image(256 - 33, 480, 'b1').setDepth(2).setAlpha(0.001)
            this.l2 = this.add.image(256 + 32, 480, 'b1').setDepth(2).setAlpha(0.001)
        }, 300);

                                this_.tweens.add({

                                    visible: 1,
                                    duration: 50,
                                })
                                this_.tweens.add({
                                    targets: [this_.p, this_.i, this_.l, this_.l2],
                                    visible: 1,
                                    delay: 50,
                                    duration: 50,
                                })
                                this_.tweens.add({
                                    targets: [this_.p, this_.i, this_.l, this_.l2],
                                    visible: 0,
                                    delay: 100,
                                    duration: 50,
                                })
                                this_.tweens.add({
                                    targets: [this_.p, this_.i, this_.l, this_.l2],
                                    visible: 1,
                                    delay: 150,
                                    duration: 50,
                                    onComplete: () => {
                                        this_.p.clearTint()
                                        this_.i.clearTint()
                                        this_.l.clearTint()
                                        this_.l2.clearTint()
                                    }
                                })
                            }
                            for (let i = 0; i < w_arr.length; i++) {
                                w_arr[i].setTint(0xDC143C)
                                var a = w_arr[i]
                                this_.tweens.add({
                                    targets: [a],
                                    visible: 0,
                                    duration: 50,
                                })
                                this_.tweens.add({
                                    targets: [a],
                                    visible: 1,
                                    delay: 50,
                                    duration: 50,
                                })
                                this_.tweens.add({
                                    targets: [a],
                                    visible: 0,
                                    delay: 100,
                                    duration: 50,
                                })
                                this_.tweens.add({
                                    targets: [a],
                                    visible: 1,
                                    delay: 150,
                                    duration: 50,
                                })
                            }
                            setTimeout(() => {
                                for (let j = 0; j < w_arr.length; j++) {

                                }
                                w_arr = []
                                hand_arr = result = []
                            }, 200);

                })
            }
            for (var i = 0; i < box.length; i++) {
                box_arr[i] = this.add.image(box[i].x, box[i].y, 'box').setDepth(2).setScale(0.8, 0.8)
            }
        }
    }


    showDownload() {
        var rect = new Phaser.Geom.Rectangle(0, 0, game.config.width, game.config.height);
        var graphics1 = this.add.graphics({
            fillStyle: {
                color: 0x000000
            }
        });
        graphics1.alpha = 0.2;
        graphics1.setDepth(8);
        graphics1.fillRectShape(rect);
        var win_bg = this.add.image(256, -400, 'nice').setDepth(10)
        var down = this.add.image(256, 520, 'continue').setDepth(10).setScale(0, 0).setInteractive().on('pointerdown', () => {
            landingPage()
        })
        this.tweens.add({
            targets: [win_bg],
            y: 400,
            duration: 800,
            ease: 'Back',
            onComplete: () => {
                this.tweens.add({
                    targets: [down],
                    scaleX: 1,
                    scaleY: 1,
                    duration: 500,
                    onComplete: () => {
                        setInterval(() => {
                            this.tweens.add({
                                targets: [down],
                                scaleX: 1.1,
                                scaleY: 1.1,
                                duration: 300,
                                onComplete: () => {
                                    this.tweens.add({
                                        targets: [down],
                                        scaleX: 1,
                                        scaleY: 1,
                                        duration: 300,
                                        onComplete: () => {

                                        }
                                    })
                                }
                            })
                        }, 600);

                    }
                })
            }
        })
    }
    hand() {
        this.hand = this.add.image(-100, 0, 'hand').setDepth(10).setOrigin(0.3, 0.1).setVisible(0)
        setInterval(() => {
            this.tweens.add({
                targets: [this.hand],
                scaleX: 1,
                scaleY: 1,
                duration: 300,
                onComplete: () => {
                    this.tweens.add({
                        targets: [this.hand],
                        scaleX: 1.1,
                        scaleY: 1.1,
                        duration: 300,
                        onComplete: () => {}
                    })
                }
            })
        }, 600);
    }
    showHand() {

        if (hand_arr.length == 0) {
            this.hand.x = 256 + 80
            this.hand.y = 630 - 30
        }
        if (hand_arr[hand_arr.length - 1] == 'i') {
            this.hand.x = 256 + 80
            this.hand.y = 690 - 10
        }


    }
    resize() {
        var canvas = document.querySelector("canvas");
        var windowWidth = window.innerWidth;
        var windowHeight = window.innerHeight;
        var windowRatio = windowWidth / windowHeight;
        var gameRatio = game.config.width / game.config.height;
        if (windowRatio < gameRatio) {
            canvas.style.width = windowWidth + "px";
            canvas.style.height = (windowWidth / gameRatio) + "px";
            v.style.width = windowWidth + "px";
            v.style.height = (windowWidth / gameRatio) + "px";
            c.style.width = windowWidth + "px";
            c.style.height = (windowWidth / gameRatio) + "px";
            mg.style.width = windowWidth + "px";
            mg.style.height = (windowWidth / gameRatio) + "px";
        } else {
            canvas.style.width = (windowHeight * gameRatio) + "px";
            canvas.style.height = windowHeight + "px";
            v.style.width = (windowHeight * gameRatio) + "px";
            v.style.height = windowHeight + "px";
            c.style.width = (windowHeight * gameRatio) + "px";
            c.style.height = windowHeight + "px";
            mg.style.width = (windowHeight * gameRatio) + "px";
            mg.style.height = windowHeight + "px";
        }
    }
}
